		public int decodeStr__NumberMax4095(string strMax4095)
		{


			int resultInt = decodeAsCharNumberMax64(strMax4095[0]) * 64 + decodeAsCharNumberMax64(strMax4095[1]) * 1;

			// # resultInt = 0
			return resultInt;
